import { Link } from "react-router-dom";
const DUMMY_EVENTS = [
	{ id: "e1", title: "Some things like that" },
	{ id: "e2", title: "Some people like that" },
];
const EventsPage = (props) => {
	return (
		<div>
			<p>Event Page</p>
			<ul>
				{DUMMY_EVENTS.map((event) => (
					<li key={event.id}>
						{" "}
						<Link to={`/events/${event.id}`} />{" "}
					</li>
				))}
			</ul>
		</div>
	);
};

export default EventsPage;
